import React from "react"
import Products from "./components/Products/Products"
import Navigation from "./components/Navigation/Navigation"
import Input from "./components/Input"
import "./css/style.css"

class App extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      page: 0, 
      isLoaded: false
    }

    this.changeParentValue = this.changeParentValue.bind(this)
  }

  changeParentValue(page, isLoaded) {
    this.setState({
      page: page, 
      isLoaded: isLoaded
    })
  }

  render() {
    return (
      <main>
          <Input />
          <Navigation page = {this.state.page} />
          <Products page = {this.state.page} isLoaded = {this.state.isLoaded} changeParentValue = {this.changeParentValue} />
          <Navigation page = {this.state.page} />
      </main>
    )
  }
}

export default App
